} Pairs iterators are also commonly used via the next method directly. If a rule consists of a known number of sub-rules (for instance, the rule sum has exactly two sub-rules), the sub-matches can be extracted with next and unwrap: let parse_result = Parser::parse(Rule::sum, "1773 + 1362") .unwrap().next().unwrap();
