We'll build up a grammar section by section, starting with the program rule: program = _{ SOI ~ "
"* ~ (stmt ~ "
"+) * ~ stmt? ~ EOI } Each J program contains statements delimited by one or more newlines. Notice the leading underscore, which tells pest to silence the program rule — we don't want program to appear as a token in the parse stream, we want the underlying statements instead. A statement is simply an expression, and since there's only one such possibility, we also silence this stmt rule as well, and thus our parser will receive an iterator of underlying exprs: stmt = _{ expr } An expression can be an assignment to a variable identifier, a monadic expression, a dyadic expression, a single string, or an array of terms: expr = { assgmtExpr | monadicExpr | dyadicExpr | string | terms
} A monadic expression consists of a verb with its sole operand on the right; a dyadic expression has operands on either side of the verb. Assignment expressions associate identifiers with expressions. In J, there is no operator precedence — evaluation is right-associative (proceeding from right to left), with parenthesized expressions evaluated first. monadicExpr = { verb ~ expr } dyadicExpr = { (monadicExpr | terms) ~ verb ~ expr } assgmtExpr = { ident ~ "=:" ~ expr } A list of terms should contain at least one decimal, integer, identifier, or parenthesized expression; we care only about those underlying values, so we make the term rule silent with a leading underscore: terms = { term+ } term = _{ decimal | integer | ident | "(" ~ expr ~ ")" } A few of J's verbs are defined in this grammar; J's full vocabulary is much more extensive. verb = { ">:" | "*:" | "-" | "%" | "#" | ">." | "+" | "*" | "<" | "=" | "^" | "|" | ">" | "$"
} Now we can get into lexing rules. Numbers in J are represented as usual, with the exception that negatives are represented using a leading _ underscore (because - is a verb that performs negation as a monad and subtraction as a dyad). Identifiers in J must start with a letter, but can contain numbers thereafter. Strings are surrounded by single quotes; quotes themselves can be embedded by escaping them with an additional quote. Notice how we use pest's @ modifier to make each of these rules atomic , meaning implicit whitespace is forbidden, and that interior rules (i.e., ASCII_ALPHA in ident) become silent — when our parser receives any of these tokens, they will be terminal: integer = @{ "_"? ~ ASCII_DIGIT+ } decimal = @{ "_"? ~ ASCII_DIGIT+ ~ "." ~ ASCII_DIGIT* } ident = @{ ASCII_ALPHA ~ (ASCII_ALPHANUMERIC | "_")* } string = @{ "'" ~ ( "''" | (!"'" ~ ANY) )* ~ "'" } Whitespace in J consists solely of spaces and tabs. Newlines are significant because they delimit statements, so they are excluded from this rule: WHITESPACE = _{ " " | "	" } Finally, we must handle comments. Comments in J start with NB. and continue to the end of the line on which they are found. Critically, we must not consume the newline at the end of the comment line; this is needed to separate any statement that might precede the comment from the statement on the succeeding line. COMMENT = _{ "NB." ~ (!"
" ~ ANY)* }

