This section will walk through a parser that uses the grammar above. Library includes and self-explanatory code are omitted here; you can find the parser in its entirety within this book's repository . First we'll enumerate the verbs defined in our grammar, distinguishing between monadic and dyadic verbs. These enumerations will be be used as labels in our AST: pub enum MonadicVerb { Increment, Square, Negate, Reciprocal, Tally, Ceiling, ShapeOf,
} pub enum DyadicVerb { Plus, Times, LessThan, LargerThan, Equal, Minus, Divide, Power, Residue, Copy, LargerOf, LargerOrEqual, Shape,
} Then we'll enumerate the various kinds of AST nodes: pub enum AstNode { Print(Box<AstNode>), Integer(i32), DoublePrecisionFloat(f64), MonadicOp { verb: MonadicVerb, expr: Box<AstNode>, }, DyadicOp { verb: DyadicVerb, lhs: Box<AstNode>, rhs: Box<AstNode>, }, Terms(Vec<AstNode>), IsGlobal { ident: String, expr: Box<AstNode>, }, Ident(String), Str(CString),
} To parse top-level statements in a J program, we have the following parse function that accepts a J program in string form and passes it to pest for parsing. We get back a sequence of Pair s. As specified in the grammar, a statement can only consist of an expression, so the match below parses each of those top-level expressions and wraps them in a Print AST node in keeping with the J interpreter's REPL behavior: pub fn parse(source: &str) -> Result<Vec<AstNode>, Error<Rule>> { let mut ast = vec![]; let pairs = JParser::parse(Rule::program, source)?; for pair in pairs { match pair.as_rule() { Rule::expr => { ast.push(Print(Box::new(build_ast_from_expr(pair)))); } _ => {} } } Ok(ast)
} AST nodes are built from expressions by walking the Pair iterator in lockstep with the expectations set out in our grammar file. Common behaviors are abstracted out into separate functions, such as parse_monadic_verb and parse_dyadic_verb, and Pair s representing expressions themselves are passed in recursive calls to build_ast_from_expr: fn build_ast_from_expr(pair: pest::iterators::Pair<Rule>) -> AstNode { match pair.as_rule() { Rule::expr => build_ast_from_expr(pair.into_inner().next().unwrap()), Rule::monadicExpr => { let mut pair = pair.into_inner(); let verb = pair.next().unwrap(); let expr = pair.next().unwrap(); let expr = build_ast_from_expr(expr); parse_monadic_verb(verb, expr) } // ... other cases elided here ... }
} Dyadic verbs are mapped from their string representations to AST nodes in a straightforward way: fn parse_dyadic_verb(pair: pest::iterators::Pair<Rule>, lhs: AstNode, rhs: AstNode) -> AstNode { AstNode::DyadicOp { lhs: Box::new(lhs), rhs: Box::new(rhs), verb: match pair.as_str() { "+" => DyadicVerb::Plus, "*" => DyadicVerb::Times, "-" => DyadicVerb::Minus, "<" => DyadicVerb::LessThan, "=" => DyadicVerb::Equal, ">" => DyadicVerb::LargerThan, "%" => DyadicVerb::Divide, "^" => DyadicVerb::Power, "|" => DyadicVerb::Residue, "#" => DyadicVerb::Copy, ">." => DyadicVerb::LargerOf, ">:" => DyadicVerb::LargerOrEqual, "$" => DyadicVerb::Shape, _ => panic!("Unexpected dyadic verb: {}", pair.as_str()), }, }
} As are monadic verbs: fn parse_monadic_verb(pair: pest::iterators::Pair<Rule>, expr: AstNode) -> AstNode { AstNode::MonadicOp { verb: match pair.as_str() { ">:" => MonadicVerb::Increment, "*:" => MonadicVerb::Square, "-" => MonadicVerb::Negate, "%" => MonadicVerb::Reciprocal, "#" => MonadicVerb::Tally, ">." => MonadicVerb::Ceiling, "$" => MonadicVerb::ShapeOf, _ => panic!("Unsupported monadic verb: {}", pair.as_str()), }, expr: Box::new(expr), }
} Finally, we define a function to process terms such as numbers and strings. Numbers require some manuevering to handle J's leading underscores representing negation, but other than that the process is typical: fn build_ast_from_term(pair: pest::iterators::Pair<Rule>) -> AstNode { match pair.as_rule() { Rule::integer => { let istr = pair.as_str(); let (sign, istr) = match &istr[..1] { "_" => (-1, &istr[1..]), _ => (1, &istr[..]), }; let integer: i32 = istr.parse().unwrap(); AstNode::Integer(sign * integer) } Rule::decimal => { let dstr = pair.as_str(); let (sign, dstr) = match &dstr[..1] { "_" => (-1.0, &dstr[1..]), _ => (1.0, &dstr[..]), }; let mut flt: f64 = dstr.parse().unwrap(); if flt != 0.0 { // Avoid negative zeroes; only multiply sign by nonzeroes. flt *= sign; } AstNode::DoublePrecisionFloat(flt) } Rule::expr => build_ast_from_expr(pair), Rule::ident => AstNode::Ident(String::from(pair.as_str())), unknown_term => panic!("Unexpected term: {:?}", unknown_term), }
}

